import React, { Component } from 'react';
import './Footer.css';

class Footer extends Component {
    render() {
        return (
            <div id="footer">
                <h3>
                    Created by D'Andre Campbell, 2020
                </h3>
            </div>
        )
    }
}

export default Footer;
